    height: '400px',
    width: '12vw',
    borderRight: '1px solid black'
  }

  return (
    <div style={{DayCtr, ...props.css}} onMouseEnter={() => props.border(false)} onMouseLeave={() => props.border(true)}>
      
    </div>
  )
}

export default Day;
